import React from 'react';

import './index.css';

import Logo from '../../assets/logo.png';


export function Header()
{
    return(
        <div className="headerContent">
            <div className="content">
                <img src={Logo} alt="Logo Rocketseat"/>
            </div>
        </div>
    )

}
